LSMTree<K, V>
- lsm_dir_path: PathBuf,
+ list: Pin<Box< AtomicLinkedList< CommittedEntrySet<K,V> > >>
- list_ver_state : VersionState<ListVer>
- dangling_slices : Pin<Box< AtomicQueue< DanglingSlice<K,V> > >>
- unique_id : Mutex <PersistedU64<UniqueId>>
+ load_or_new(PathBuf) -> Res<Self>
+ get_one (
Opt<&WritableMemLog<K,V>>,
commit_ver_hi_excl: Opt<CommitVer>,
commit_ver_lo_incl: Opt<CommitVer>,
&Q,
on_trailing_list_ver_advanced: FnOnce(),
) -> Result<Opt<(K, V)>>
// We could return Entry here, and defer `Arc::clone()`ing to caller.
// But for developer convenience, return owned (K, V) instead.
// We filter out Tombstone.
list_ver_ = list_ver_state . hold_leading ();
found = /* Traverse from newest to oldest entryset. Stop when found. */
list_ver_state . unhold (list_ver_, on_trailing_list_ver_advanced);
return found;
+ get_range (
Opt<&WritableMemLog<K,V>>,
commit_ver_hi_excl: Opt<CommitVer>,
commit_ver_lo_incl: Opt<CommitVer>,
k_lo: Opt<&Q>,
k_hi: Opt<&Q>,
handle_entries: FnOnce(Iter<Entry<K,V>>) -> CbEntRet,
on_trailing_list_ver_advanced: FnOnce(),
) -> CbEntRet
list_ver_ = list_ver_state . hold_leading ();
entries = /* K-merge. Then filter out Tombstones. */
cb_ret = handle_entries(entries);
list_ver_state . unhold (list_ver_, on_trailing_list_ver_advanced);
return cb_ret;
+ iter_entrysets (
commit_ver_hi_excl: Opt<CommitVer>,
commit_ver_lo_incl: Opt<CommitVer>,
handle_entrysets: FnOnce(Iter<&CommittedEntrySet<K,V>>) -> CbEntRet
on_trailing_list_ver_advanced: FnOnce(),
) -> CbEntRet
list_ver_ = list_ver_state . hold_leading ();
entrysets = /* list.iter() */
cb_ret = handle_entries(entrysets);
list_ver_state . unhold (list_ver_, on_trailing_list_ver_advanced);
return cb_ret;
